import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "../components/Pages/Home";
import menu from "../globals";
import { PrivateRoute } from "./PrivateRoute";
import { PublicRoute } from "./PublicRoute";


// Route is accessible by anybody
// PublicRoute is only accessible by non connected users
// PrivateRoute is only accessible by connected users

export default function Routes() {
    return (
        <Switch>
            <Route path="/" exact component={Home} />
            <PublicRoute path="/signup" exact component={SignUp} />
            {menu.map((item) => (
                item.public ?
                <Route path={item.route} exact component={item.component} />
                :
                <PrivateRoute path={item.route} exact component={item.component} />
            ))}
        </Switch>
    );
}
